class Application(tk.Frame):
    def __init__(self, master=None):
        super().__init__(master)
        self.master = master
        self.pack()
        self.master.title(f"{logiciel} - {version}")
        self.create_widgets()

    def create_widgets(self):
        # Création d'un canvas avec scrollbar
        self.canvas = tk.Canvas(self.master)

            if not is_linux():

                script_path = os.path.abspath(__file__)

                # Construire la commande pour exécuter le script en tant que root
                command = f"sudo python3 {script_path}"

                # Exécuter la commande en tant que root
                os.system(command)

                # Quitter l'application
                sys.exit(0)
            else:
